        body {

        :root {
            --primary-color: #FFD700;
        }
        .romantic-font {
            font-family: 'Great Vibes', cursive;
        }
        .petal {
            cursor: pointer;
            transition: fill 0.3s ease, transform 0.3s ease;
        }
        .petal:hover {
            fill: #b38a01ff;
            transform: scale(1.05);
        }
        .petal-group {
            cursor: pointer;
        }
        .petal-group:hover .petal {
            fill: #d19d03ff;
            transform: scale(1.05);
        }
        .modal {
            position: fixed;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            background: rgba(0, 0, 0, 0.6);
            display: flex;
            align-items: center;
            justify-content: center;
            width: 100%;
            height: 100%;
            z-index: 30;
            animation: zoomIn 0.2s ease-in-out;
            border: 3px solid var(--primary-color);
            box-shadow: 0 0 25px rgba(255, 215, 0, 0.4);
        }
        @keyframes zoomIn {
            0% { opacity: 0; transform: translate(-50%, -50%) scale(0.5); }
            100% { opacity: 1; transform: translate(-50%, -50%) scale(1); }
        }
        @keyframes pulse {
            0% { transform: scale(1); }
            50% { transform: scale(1.05); }
            100% { transform: scale(1); }
        }
        .pulse {
            animation: pulse 3s infinite;
        }
        .romantic-border {
            border: 2px solid var(--primary-color);
            border-radius: 15px;
            box-shadow: 0 0 15px rgba(255, 215, 0, 0.3);
        }
        .message-bubble {
            position: fixed;
            background: #fff9e6;
            border-radius: 20px;
            padding: 20px;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
            min-width: 200px;
            max-width: 80vw;
            text-align: center;
            z-index: 20;
            box-sizing: border-box;
            transform: translate(-50%, -50%);
            animation: floatElement 2s ease-in-out infinite;
        }
        .message-bubble:after {
            content: '';
            position: absolute;
            bottom: -10px;
            left: 50%;
            border-width: 10px 10px 0;
            border-style: solid;
            border-color: #fff9e6 Transparent;
            transform: translateX(-50%);
        }
        @keyframes floatElement {
            0% { transform: translate(-50%, -50%) translateY(0px); }
            50% { transform: translate(-50%, -50%) translateY(-15px); }
            100% { transform: translate(-50%, -50%) translateY(0px); }
        }

        .modal-content {

            max-width: 50%;
            width: fit-content;
            min-width: 30%;
            text-align: center;
            border: 2px solid var(--primary-color);
            font-family: 'Satisfy', cursive;
        }
        .image-wrapper {
            position: relative;
            width: 100%;
            height: auto;
            max-height: 200px;
            overflow: hidden;
            display: flex;
            justify-content: center;
            align-items: center;
            margin-bottom: 1rem;
        }
        .image-wrapper.portrait::before {
            content: "";
            position: absolute;
            top: -20px;
            left: -20px;
            right: -20px;
            bottom: -20px;
            background-size: cover;
            background-position: center;
            filter: blur(20px);
            z-index: 0;
            border-radius: 10px;
        }
        .modal-image {
            max-width: 100%;
            max-height: 200px;
            object-fit: contain;
            position: relative;
            z-index: 1;
            border-radius: 10px;

        .modal-close {
            position: absolute;
            top: 0.5rem;

            font-size: 1.5rem;

            color: #EC4899;
            cursor: pointer;
            z-index: 100;

            color: #BE185D;

            z-index: 1;
            pointer-events: none;
            overflow: hidden;

            animation: floatUp linear infinite;
        }
        @keyframes floatUp {
            0% { transform: translateY(0); opacity: 1; }

            90% { opacity: 0.4; }
            100% { transform: translateY(-120vh); opacity: 0; }
        }
        .continue-button {

        .continue-button:hover {

            }
            .continue-button {
                font-size: 1.8rem;
                padding: 0.4rem 0.8rem;
            }
        }
        .music-control {
            position: fixed;
            top: 20px;
            right: 20px;

            flex-direction: column;
            align-items: center;
        }
        .music-btn {
            width: 50px;
            height: 50px;
            background: linear-gradient(135deg, var(--primary-color), #E6C200);
            border: none;
            border-radius: 50%;

            display: flex;
            align-items: center;
            justify-content: center;
            box-shadow: 0 5px 15px rgba(0, 0, 0, 0.4);

        }
        .music-btn:hover {
            transform: scale(1.1);

        .music-btn:active {
            transform: scale(0.95);
        }
        .music-btn svg {
            width: 24px;
            height: 24px;
            fill: #fff;
        }
        .volume-control {
            width: 120px;
            background: rgba(255, 255, 255, 0.15);
            padding: 10px;
            border-radius: 10px;
            box-shadow: 0 5px 15px rgba(0, 0, 0, 0.4);
            border: 1px solid rgba(255, 215, 0, 0.5);
            margin-top: 10px;
            display: none;
            opacity: 0;
            transform: translateY(-10px);
            transition: opacity 0.3s ease, transform 0.3s ease;
        }
        .volume-control.visible {
            display: block;
            opacity: 1;
            transform: translateY(0);
        }
        .volume-control input {
            width: 100%;

            -webkit-appearance: none;

            height: 16px;
            background: var(--primary-color);
            border-radius: 50%;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.3);
        }
        .volume-control input::-moz-range-thumb {
            width: 16px;
            height: 16px;
            background: var(--primary-color);
            border-radius: 50%;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.3);
            border: none;

            }

                width: 100px;
                margin-top: 8px;
            }
            .volume-control input {
                height: 10px;
            }
        }

        const romanticPhrases = ["Mi cosita preciosa"];

        class App extends React.Component {
            constructor(props) {
                super(props);
                this.state = {
                    petals: [0, 1, 2, 3, 4, 5, 6, 7],
                    message: null,
                    imageOrientations: {}, // Store portrait status for each image
                    showFinalMessage: false,
                    animatingPetals: {},
                    showInitialMessage: true,
                    loveNotes: []
                };
                this.hearts = [];
                for (let i = 0; i < 20; i++) {
                    this.hearts.push({
                        left: Math.random() * 100,
                        duration: 5 + Math.random() * 10,
                        size: 10 + Math.random() * 20
                    });
                }
                this.noteTimeouts = {};
            }

            componentDidMount() {
                document.body.addEventListener('click', this.handleScreenClick);
                document.body.addEventListener('touchstart', this.handleScreenClick);
                // Preload all images
                this.preloadImages();
            }

            componentWillUnmount() {
                document.body.removeEventListener('click', this.handleScreenClick);
                document.body.removeEventListener('touchstart', this.handleScreenClick);
                Object.values(this.noteTimeouts).forEach(clearTimeout);
                this.noteTimeouts = {};
            }

            preloadImages = () => {
                messages.forEach((message, index) => {
                    if (message.image) {
                        const img = new Image();
                        img.src = message.image;
                        img.onload = () => {
                            const isPortrait = img.naturalHeight > img.naturalWidth;
                            this.setState(prevState => ({
                                imageOrientations: {
                                    ...prevState.imageOrientations,
                                    [index]: isPortrait
                                }
                            }));
                        };
                        img.onerror = () => {
                            console.error(`Failed to preload image: ${message.image}`);
                        };
                    }
                });
            };

            handleScreenClick = (e) => {
                if (e.target.closest('.petal-group') || 
                    e.target.closest('#Path-stem') ||
                    e.target.closest('#Leaf') ||
                    e.target.closest('#Center') ||
                    e.target.closest('.modal') || 
                    e.target.closest('button') ||
                    e.target.classList.contains('petal')) {
                    return;
                }

                const id = Date.now() + Math.random();
                const note = {
                    id,
                    text: romanticPhrases[Math.floor(Math.random() * romanticPhrases.length)],
                    x: e.clientX || (e.touches && e.touches[0].clientX),
                    y: e.clientY || (e.touches && e.touches[0].clientY)
                };

                this.setState(prev => ({ loveNotes: [...prev.loveNotes, note] }), () => {
                    const t = setTimeout(() => {
                        this.setState(prev => ({
                            loveNotes: prev.loveNotes.filter(n => n.id !== id)
                        }));
                        delete this.noteTimeouts[id];
                    }, 1500);
                    this.noteTimeouts[id] = t;
                });
            };

            handlePetalClick = (e) => {
                e.stopPropagation();
                const petalGroup = e.target.closest('.petal-group');
                if (!petalGroup) return;
                
                const petalId = parseInt(petalGroup.id);
                const messageObj = messages[petalId] || { text: "Â¡Te amo mÃ¡s que nada!", image: null };

                setTimeout(() => {
                    this.setState(prevState => {
                        const newPetals = prevState.petals.filter(id => id !== petalId);
                        const showFinal = newPetals.length === 0;
                        return {
                            petals: newPetals,
                            message: messageObj,
                            showFinalMessage: showFinal
                        };
                    });

                    confetti({
                        particleCount: 120,
                        spread: 70,
                        origin: { y: 0.6 },
                        colors: ['#FFEB3B', '#FFC107', '#FF9800', '#FF5252', '#E91E63']
                    });
                }, 300);
            };

            closeModal = () => {
                this.setState({ message: null });
            };

            closeFinalModal = () => {
                this.setState({ showFinalMessage: false });
            };

            // Reemplaza la versiÃ³n antigua de closeInitialMessage por Ã©sta
closeInitialMessage = () => {
    this.setState({ showInitialMessage: false }, () => {
        // Intentar reproducir la mÃºsica al cerrar el modal inicial (user gesture)
        try {
            const music = document.getElementById("backgroundMusic");
            const playIcon = document.getElementById("playIcon");
            const pauseIcon = document.getElementById("pauseIcon");

            if (music) {
                // Si estÃ¡ pausado, intentar reproducir (click es user gesture => deberÃ­a funcionar)
                if (music.paused) {
                    music.play().then(() => {
                        // Actualizar iconos cuando empieza a reproducir
                        if (playIcon) playIcon.style.display = 'none';
                        if (pauseIcon) pauseIcon.style.display = 'block';
                    }).catch(err => {
                        // Si falla (raro en un click de usuario), lo registramos en consola
                        console.warn('No se pudo reproducir el audio al cerrar el modal:', err);
                    });
                } else {
                    // Si ya estaba reproduciÃ©ndose, aseguramos iconos correctos
                    if (playIcon) playIcon.style.display = 'none';
                    if (pauseIcon) pauseIcon.style.display = 'block';
                }
            }
        } catch (e) {
            console.error('Error al intentar iniciar la mÃºsica:', e);
        }
    });
};


            renderLoveNotes = () => {
                return this.state.loveNotes.map(note => (
                    <div

        function setupMusicControls() {
    const music = document.getElementById("backgroundMusic");
    const musicBtn = document.getElementById("musicBtn");
    const playIcon = document.getElementById("playIcon");
    const pauseIcon = document.getElementById("pauseIcon");
    const volumeSlider = document.getElementById("volumeSlider");
    const volumeControl = document.getElementById("volumeControl");

    let hideVolumeTimeout = null;

    if (!music || !musicBtn || !volumeSlider || !volumeControl) {
        console.error('Music or control elements not found');
        return;
    }

    // Establecer volumen inicial desde slider
    music.volume = parseFloat(volumeSlider.value || 0.5);

    // No forzamos play() aquÃ­ para evitar bloqueos por autoplay en navegadores.
    // Ajustamos los iconos segÃºn el estado actual del audio.
    if (music.paused) {
        if (playIcon) playIcon.style.display = 'block';
        if (pauseIcon) pauseIcon.style.display = 'none';
    } else {
        if (playIcon) playIcon.style.display = 'none';
        if (pauseIcon) pauseIcon.style.display = 'block';
    }

    function toggleMusic() {
        if (music.paused) {
            music.play().then(() => {
                if (playIcon) playIcon.style.display = 'none';
                if (pauseIcon) pauseIcon.style.display = 'block';
            }).catch(error => {
                console.error('Error playing audio:', error.message);
            });
        } else {
            music.pause();
            if (playIcon) playIcon.style.display = 'block';
            if (pauseIcon) pauseIcon.style.display = 'none';
        }
    }

    musicBtn.addEventListener("click", (e) => {
        e.stopPropagation();
        toggleMusic();
        if (!volumeControl.classList.contains("visible")) {
            volumeControl.classList.add("visible");
            clearTimeout(hideVolumeTimeout);
            hideVolumeTimeout = setTimeout(() => volumeControl.classList.remove("visible"), 2000);
        } else {
            volumeControl.classList.remove("visible");
        }
    });

    volumeSlider.addEventListener("input", (e) => {
        music.volume = parseFloat(e.target.value);
        clearTimeout(hideVolumeTimeout);
        volumeControl.classList.add("visible");
    });

    volumeSlider.addEventListener("change", () => {
        hideVolumeTimeout = setTimeout(() => volumeControl.classList.remove("visible"), 2000);
    });

    document.addEventListener("click", (e) => {
        if (!volumeControl.contains(e.target) && !musicBtn.contains(e.target)) {
            volumeControl.classList.remove("visible");
            clearTimeout(hideVolumeTimeout);
        }
    });
}


                setupMusicControls();
